description:
Beauty from Pain is the fifth album released by the Christian pop rock band Superchic[k]. This is the first CD the band has released with an official drummer, Brandon Estelle.
Track list

   1. &quot;Anthem&quot;
   2. &quot;Pure&quot;
   3. &quot;Bowling Ball&quot;
   4. &quot;Stories (Down to the Bottom)&quot;
   5. &quot;Wishes&quot;
   6. &quot;Beauty from Pain&quot;
   7. &quot;It&amp;#039;s On&quot;
   8. &quot;Suddenly&quot;
   9. &quot;Courage&quot;
  10. &quot;We Live&quot;
